directions = {'n':(2,0), 'ne':(1,1), 'se':(-1,1), 's':(-2,0), 'sw':(-1, -1), 'nw':(1, -1)}
pref = [(-1,-1), (1,-1),(1,1), (-1,1)]
other = [(-2,0),(2,0)]
def move_out(dirs):
    location = [0,0]
    for ins in dirs.split(','):
        change = directions[ins]
#         print('{} -> {} {}'.format(location, ins, change))
        location[0] += change[0]
        location[1] += change[1]
    return location
def find_steps_back(location):
    steps = 0
    while location != [0,0]:
        x, y = location
        flag = False
        for pre in pref:
            dx, dy = pre
            if flag:
                break
            if abs(x+dx) < abs(x) and abs(y+dy) < abs(y):
#                 print('{} ->{}-> {}'.format(location, pre, (dx+x, dy+y)))
                location = [x+dx, y+dy]
                steps += 1
                flag = True
        for ot in other:
            if flag:
                break
            dx, dy = ot
            if abs(x+dx) <= abs(x) and abs(y+dy) <= abs(y):
#                 print('{} ->{}-> {}'.format(location, ot, (dx+x, dy+y)))
                location = [x+dx, y+dy]
                steps += 1
                flag = True
        flag = False
    return steps
def solve(directions):
    loc = move_out(directions)
    steps = find_steps_back(loc)
    return steps
    
# print(solve(data))
assert solve('ne,ne,ne') == 3
assert solve('ne,ne,sw,sw') == 0
assert solve('ne,ne,s,s') == 2
assert solve('se,sw,se,sw,sw') == 3
# In[7]:
def move_out(dirs):
    location = [0,0]
    furtest = 0
    for ins in dirs.split(','):
        change = directions[ins]
#         print('{} -> {} {}'.format(location, ins, change))
        location[0] += change[0]
        location[1] += change[1]
        new_steps = find_steps_back(location)
        furtest = max(furtest, new_steps)
    return furtest
memory = {(0,0):0}
def find_steps_back(location):
    in_loc = location
    steps = 0
    while location != [0,0]:
        if tuple(location) in memory:
#             print('{} found in memory steps: {}'.format(location, memory[tuple(location)]))
            return steps+memory[tuple(location)]
        x, y = location
        flag = False
        for pre in pref:
            dx, dy = pre
            if flag:
                break
            if abs(x+dx) < abs(x) and abs(y+dy) < abs(y):
#                 print('{} ->{}-> {}'.format(location, pre, (dx+x, dy+y)))
                location = [x+dx, y+dy]
                steps += 1
                flag = True
        for ot in other:
            if flag:
                break
            dx, dy = ot
            if abs(x+dx) == 0 and abs(y+dy) > 0:
                continue
            if abs(x+dx) <= abs(x) and abs(y+dy) <= abs(y):
#                 print('{} ->{}-> {}'.format(location, ot, (dx+x, dy+y)))
                location = [x+dx, y+dy]
                steps += 1
                flag = True
        if not flag:
            for pre in pref:
                dx, dy = pre
                if abs(y + dy) < abs(y):
#                     print('{} ->{}-> {}'.format(location, pre, (dx+x, dy+y)))
                    location = [x+dx, y+dy]
                    steps += 1
    memory[tuple(in_loc)] = steps
    return steps
def solve(directions):
    return move_out(directions)
