def solve(data):
    length = int(data[-1].split(': ')[0])+1
    datas = []
    for dat in data:
        a, b = dat.split(': ')
        node = int(a)
        depth = int(b)
        datas.append((node, (depth-1)*2))
#     print(datas)
    pause = 0
    caught = True
    while caught:
        pause += 1
        for node in datas:
            if (pause+node[0])%node[1] == 0:
#                 print("caught at node {} with pause {}".format(node[0], pause))
                break
        else:
            caught=False
    return pause
        
        
