def get_row(khash):
    row = list("".join(['{:04b}'.format(int(ch,16)) for ch in khash]))
    return row
def solve(data):
    used = 0
    for x in range(128):
        khash = knothash('{}-{}'.format(data, x))
        used += 128-(sorted(get_row(khash)).index('1'))
    return used
    
